import React from "react";

const Mission = () =>{
    return(
        <section className="mission" data-aos="zoom-in-up">
        <div className="container">
        {/* <img src="../Images/Rectangle.png" alt="" /> */}
            <div className="row" >
                <div className="col-12">
                <h4>Our Mission</h4>
                <h3>Enhance The Quality Of Our Farmer Life</h3>
                <p>Al-Asr Group technical field team activities to increase the per acre yield of farmers, value addition in the overall income of farmers.</p>

                </div>
            </div>
        </div>

        </section>

    )
}

export default Mission;
